always_true.source:
/// Test 001: Always True validator
/// The simplest possible validator - always succeeds

validator always_true {
  spend(_datum: Option<Data>, _redeemer: Data, _output_ref: Data, _tx: Data) {
    True
  }
}

three_variants.source:
/// Test 003: Three redeemer variants with fields

pub type Redeemer {
  Cancel
  Claim { amount: Int }
  Update { new_value: Int }
}

validator three_variants {
  spend(_datum: Option<Data>, redeemer: Redeemer, _output_ref: Data, _tx: Data) {
    when redeemer is {
      Cancel -> True
      Claim { amount } -> amount > 0
      Update { new_value } -> new_value >= 0
    }
  }
}

two_variants.source:
/// Test 002: Two redeemer variants
/// Simple pattern matching

pub type Redeemer {
  Accept
  Reject
}

validator two_variants {
  spend(_datum: Option<Data>, redeemer: Redeemer, _output_ref: Data, _tx: Data) {
    when redeemer is {
      Accept -> True
      Reject -> False
    }
  }
}
